initial.4.site <- function(recomb.probs) {
    if (length(recomb.probs) != 3) {
        stop("recomb.probs is incorrect length")
    }

    p_0 <- recomb.probs[1]
    p_1 <- recomb.probs[2]
    p_2 <- recomb.probs[3]

    ## implicit return
    c(-1/4*(p_0 - 1)*(p_1 - 1)*(p_2 - 1) + 1/4,
      1/4*p_0*(p_1 - 1)*(p_2 - 1),
      -1/4*p_0*p_1*(p_2 - 1),
      1/4*(p_0 - 1)*p_1*(p_2 - 1),
      -1/4*(p_0 - 1)*p_1*p_2,
      1/4*p_0*p_1*p_2,
      -1/4*p_0*(p_1 - 1)*p_2,
      1/4*(p_0 - 1)*(p_1 - 1)*p_2,
      1/4*(p_0 - 1)*(p_1 - 1)*p_2,
      -1/4*p_0*(p_1 - 1)*p_2,
      1/4*p_0*p_1*p_2,
      -1/4*(p_0 - 1)*p_1*p_2,
      1/4*(p_0 - 1)*p_1*(p_2 - 1),
      -1/4*p_0*p_1*(p_2 - 1),
      1/4*p_0*(p_1 - 1)*(p_2 - 1),
      -1/4*(p_0 - 1)*(p_1 - 1)*(p_2 - 1) + 1/4)
}


